import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Container from '@mui/material/Container';
import Paper from '@mui/material/Paper';

export default function ContactPage(){

return(
<Container maxWidth="md" sx={ 
    {
         display:'flex'
        ,flexDirection:'column'
        ,justifyContent:'center'
        ,alignItems:'center'
        
        } 
}>
<Paper elevation={1}
              sx={{  margin: 1, padding: 1, backgroundColor: '#333' }
              }
              >
<div>
<Box
        component="form"
        sx={{
            width: '100%',
            height: 700,
            display: 'flex',
            flexWrap: 'wrap',
            flexDirection: 'column',
            justifyContent: 'center',
            alignItems: 'center',

          '& .MuiTextField-root': { m: 1, width: '25ch' },
        }}
        noValidate
        autoComplete="off"
      >
        <Box>Contact Form</Box>
        <div>
          <TextField id="filled-basic" label="Name" variant="filled" /></div>
          <div>
              <TextField
                id="filled-basic"
                label="Email"
                variant="filled"
              />
          </div>
          <div>
              <TextField sx={{width: 500} }
                id="filled-textarea"
                label="Message"
                placeholder="Placeholder"
                multiline
                variant="filled"
                
              />
          </div>
        
      </Box>
</div>
</Paper>
</Container>
)
                
}
